CREATE TABLE emp_range_list
       (EMPNO NUMBER NOT NULL,
        ENAME VARCHAR2(10),
        JOB VARCHAR2(9),
        MGR NUMBER(4),
        HIREDATE DATE,
        SAL NUMBER(7, 2),
        COMM NUMBER(7, 2),
        DEPTNO NUMBER(2))
PARTITION BY RANGE (deptno)
SUBPARTITION BY LIST (job)
(PARTITION emp_p1 VALUES LESS THAN (11)
  (SUBPARTITION sub1_job_p1 VALUES ('MANAGER'),
   SUBPARTITION sub1_job_p2 VALUES ('SALESMAN'),
   SUBPARTITION sub1_job_p3 VALUES ('ANALYST'),
   SUBPARTITION sub1_job_p4 VALUES ('PRESIDENT', 'CLERK')),
 PARTITION emp_p2 VALUES LESS THAN (21)
  (SUBPARTITION sub2_job_p1 VALUES ('MANAGER'),
   SUBPARTITION sub2_job_p2 VALUES ('SALESMAN'),
   SUBPARTITION sub2_job_p3 VALUES ('ANALYST'),
   SUBPARTITION sub2_job_p4 VALUES ('PRESIDENT', 'CLERK')),
 PARTITION emp_p3 VALUES LESS THAN (31)
  (SUBPARTITION sub3_job_p1 VALUES ('MANAGER'),
   SUBPARTITION sub3_job_p2 VALUES ('SALESMAN'),
   SUBPARTITION sub3_job_p3 VALUES ('ANALYST'),
   SUBPARTITION sub3_job_p4 VALUES ('PRESIDENT', 'CLERK')) ,
 PARTITION emp_p4 VALUES LESS THAN (41)
  (SUBPARTITION sub4_job_p1 VALUES ('MANAGER'),
   SUBPARTITION sub4_job_p2 VALUES ('SALESMAN'),
   SUBPARTITION sub4_job_p3 VALUES ('ANALYST'),
   SUBPARTITION sub4_job_p4 VALUES ('PRESIDENT', 'CLERK'))
)
/
ALTER TABLE emp_range_list
   ADD PARTITION emp_p5 VALUES LESS THAN (51)
  (SUBPARTITION sub5_job_p1 VALUES ('MANAGER'),
   SUBPARTITION sub5_job_p2 VALUES ('SALESMAN'),
