CREATE TABLE AMM_SAUP_TRAN_T
(
  SAUPREQ_ID     VARCHAR2(28)              NOT NULL,
  REQER_ID       VARCHAR2(13),
  SAUP_CD        VARCHAR2(8),
  SAUP_YEAR      CHAR(4),
  ORG_CD         VARCHAR2(7),
  SUB_ORG_CD     VARCHAR2(7),
  REQER_ADDR_CD  VARCHAR2(10),
  ONLINEGB_CD    VARCHAR2(6),
  GROUPGB_CD     VARCHAR2(6),
  REQERGB_CD     VARCHAR2(6),
  REQGB_CD       VARCHAR2(6),
  REQCANCEL_CD   VARCHAR2(6),
  PROGRESS_CD    VARCHAR2(6),
  REQ_DT         DATE                           DEFAULT SYSDATE,
  REQER_NM       VARCHAR2(60),
  OWNER_NM       VARCHAR2(60),
  SMS_SEND_GB    CHAR(1)                   DEFAULT 'Y',
  EMAIL_SEND_GB  CHAR(1)                   DEFAULT 'Y',
  PROMISE_CD     VARCHAR2(6),
  REG_ID         VARCHAR2(20),
  MOD_ID         VARCHAR2(20),
  REG_DT         DATE                           DEFAULT SYSDATE,
  MOD_DT         DATE                           DEFAULT SYSDATE,
  USE_GB         CHAR(1)                   DEFAULT 'Y',
  TERMGB_CD      VARCHAR2(6)
)
PARTITION BY RANGE (SAUP_YEAR)
(
  PARTITION AMM_SAUP_TRAN_PART_01 VALUES LESS THAN ('2004'),
  PARTITION AMM_SAUP_TRAN_PART_02 VALUES LESS THAN ('2006'),
  PARTITION AMM_SAUP_TRAN_PART_03 VALUES LESS THAN ('2008'),
  PARTITION AMM_SAUP_TRAN_PART_04 VALUES LESS THAN ('2010'),
  PARTITION AMM_SAUP_TRAN_PART_05 VALUES LESS THAN (MAXVALUE)
)
/
CREATE UNIQUE INDEX TX_AMM_SAUP_TRAN_01 ON AMM_SAUP_TRAN_T
(SAUP_YEAR, SAUPREQ_ID)
/
CREATE INDEX TX_AMM_SAUP_TRAN_02 ON AMM_SAUP_TRAN_T
(SAUP_YEAR, SAUP_CD, ORG_CD, SUB_ORG_CD, SAUPREQ_ID)
/
CREATE INDEX TX_AMM_SAUP_TRAN_03 ON AMM_SAUP_TRAN_T
(REQER_ID)
/
CREATE INDEX TX_AMM_SAUP_TRAN_04 ON AMM_SAUP_TRAN_T
(SAUPREQ_ID)
/
ALTER TABLE AMM_SAUP_TRAN_T ADD (
  PRIMARY KEY
 (SAUP_YEAR, SAUPREQ_ID))
/
